        isPrimaryAction(event) {
            const prop = this.getConfig("primaryActionKey") || "none";
            if(prop=="none") {
                return !(event.altKey || event.ctrlKey || event.shiftKey);
            }
            else {
                return event[prop];
            }
        }

        isAltAction(event) {
            const prop = this.getConfig("altActionKey") || "altKey";
            return event[prop];
        }

