        maxCookable(food) {
            return Cooking.can_cook_how_many(food) || 0;
        }

        quickCook(food, alt) {
            const max = this.maxCookable(food);
            let n = max;
            if(alt) {
                const owned = IdlePixelPlus.getVarOrDefault(food, 0, "int");
                if(owned==max) {
                    n--;
                }
            }
            if(n > 0) {
                IdlePixelPlus.sendMessage(`COOK=${food}~${n}`);
            }
        }

